enum Status {
    Active,
    Inactive,
    Pending
}

class Task {
    private title: string;
    private status: Status;

    constructor(title: string) {
        this.title = title;
        this.status = Status.Pending;
    }

    setStatus(status: Status): void {
        this.status = status
    }

    isActive(): boolean {
        return this.status === Status.Active;
    }
}
